import { Component } from "react";
import Header from "./component/Header.js";
import Car from "./component/Car.js";
import Footer from "./component/Footer.js";
import User from "./component/User.js";
import imgProfile from "./component/man.jpeg"

// functionnya di sebut komponen
function App() {
  return (
    <div className="App">
      {/* cara manggil komponen ada 2 cara*/}
      {/* pertama */}
      <Header />
      {/* kedua */}
      {/* <Header></Header> */}
      <h1>Hello World</h1>
      {/* kalau tipe datanya nya string maka gunakan tanda kutif,
      jika tipe datanya integer maka gunakan kurung kurawal,
      kalau tipe datanya Boolean maka gunakan isNew kurung kurawal, 
      jika tipe datanya array maka gunakan kurung kurawal,
      kalau berupa function maka gunakan callback function
      */}
      <Car
        merk="Ferrari"
        harga={5}
        isNew={true}
        colors={["Hitam", "Putih", "Abu-abu"]}
        beli={() => alert("Sudah di beli")}
      />
      <Footer nama="Fajar Abdul Jabar" />
      <User
        nama="Ucup"
        alamat="Jakarta"
        angkatan={11}
        hobi={["Bernang", "Bermain Game", "Membaca Buku"]}
        status={false}
        gambar="https://cdn-icons-png.flaticon.com/512/1077/1077114.png"
        button={() => alert("Profil  telah dibuka")}
      />
       <User
        nama="Rafi"
        alamat="Tanggerang"
        angkatan={10}
        hobi={["Bernang", "Bermain Game", "Membaca Buku"]}
        status={false}
        gambar="data:image/png;base64,"
        button={() => alert("Profil  telah dibuka")}
      />
      <User
        nama="Galih"
        alamat="Bandung"
        angkatan={9}
        hobi={["Bernang", "Bermain Game", "Membaca Buku"]}
        status={false}
        gambar={imgProfile}
        button={() => alert("Profil ',{nama}' telah dibuka")}
      />
    </div>
  );
}


export default App;
